import React from 'react';
import styled from "styled-components";
import {Button, ButtonArrow, Container, Subtitle, Title} from "../../styles/common";

const StyledNews = styled(Container)`
  padding-top: 9rem;
  padding-bottom: 9rem;
`

const NewsHeader = styled.div`
  display: flex;
  align-items: end;
  justify-content: space-between;
  gap: 2rem;
`

const NewsHeaderTitleBlock = styled.div`
  max-width: 970px;
`

function News() {
  return (
    <StyledNews>
      <NewsHeader>
        <NewsHeaderTitleBlock>
          <Subtitle>News</Subtitle>
          <Title>Discover weekly content about organic food, & more</Title>
        </NewsHeaderTitleBlock>
        <Button $backgroundColor="#FFFFFF" $border="2px solid #274C5B">
          <div>More News</div>
          <ButtonArrow>
            <img src="./img/common/arrow.svg" alt=""/>
          </ButtonArrow>
        </Button>
      </NewsHeader>
    </StyledNews>
  );
}

export default News;
